export class WsFrameHeader {
    fin;
    opcode;
    length;
    mask;
    constructor(fin, opcode, length, mask) {
        this.fin = fin;
        this.opcode = opcode;
        this.length = length;
        this.mask = mask;
    }
}
export class WsPingFrame extends WsFrameHeader {
    data;
    constructor(fin, opcode, length, mask, data) {
        super(fin, opcode, length, mask);
        this.data = data;
    }
}
export class WsPongFrame extends WsFrameHeader {
    data;
    constructor(fin, opcode, length, mask, data) {
        super(fin, opcode, length, mask);
        this.data = data;
    }
}
export class WsCloseFrame extends WsFrameHeader {
    code;
    reason;
    constructor(fin, opcode, length, mask, code, reason) {
        super(fin, opcode, length, mask);
        this.code = code;
        this.reason = reason;
    }
}
